import { http, HttpResponse } from 'msw'

export const handlers = [
    http.post("/getPhoneCompatibility", (req, res, ctx) => {
        console.log(req.body);
        return res(
            ctx.json({
                "status": "success",
                "data": {
                    "compatible": true,
                    "message": "Your phone is compatible with US Mobile"
                }
            })
        )
    })
];
